import React from "react";
import {profile} from "./img/export";

class aboutMe extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return(
          <div>
              <img alt='profile' src={profile}/>
              <p>im Idan Bunimovich Completed successfully second year of computer science major at the Interdisciplinary Center Herzliya (“IDC”).</p>
          </div>
        );
    }
}
export default aboutMe;
